import math

def count_palindromic_times(s: str, x: int) -> int:
    palindromes = []
    for i in range(24):
        if i % 10 < 6:
            if i < 10:
                e = '0' + str(i)
                a = str(i % 10) + str(i // 10)
                palindromes.append(e + a)
            else:
                a = i % 10 * 10 + i // 10
                palindromes.append(str(i * 100 + a))
    (h, m) = s.split(':')
    time = int(h) * 60 - int(m)
    min_step = math.gcd(x, 1440)
    otvet = 0
    for palindrome in palindromes:
        if (int(palindrome) % 100 + int(palindrome) // 100 * 60 - time) % min_step == 0:
            otvet += 1
    return otvet

